window.bookSummaryJSON = "<p>I ate six seeds. Now I owe six months of debt to a dangerously sexy Fae hitman.</p> <p>I'd had everything a dryad could want - a job, an apartment, and a scandalous human boyfriend-</p> <p>Until I stole the wrong fruit from the wrong Fae.</p> <p>Dragged into the Seelie underworld of deception and lies, I do anything he commands: steal, spy, even fight as we hunt down a notorious Fae fugitive.</p> <p>Not exactly the fun I was looking for, despite the intense attraction between us. Between my new boss, the cold-as-ice Unseelie fixer, and a gorgeous Wild Hunter, I'm pulled into a world where danger is the only guarantee.</p> <p>But when the mission ends, I may not want to leave.</p> <p><b>Contains mature themes.</b></p>"; 
